import './App.css';
import './index.css';
import Navbar from './Navbar'
import About from './Pages/About'
import Courses from './Pages/Courses'
import Home from './Pages/Home'


function App() {

  const columns = [
    {
      key: "john",
      value: "John Doe",
    },
    {
      key: "jane",
      value: "Jane Doe",
    },
    {
      key: "mary",
      value: "Mary Phillips",
    },
    {
      key: "robert",
      value: "Robert",
    },
    {
      key: "karius",
      value: "Karius",
    },
  ];

  let Component
  switch(window.location.pathname){
    case "/":
      Component = Home
      break

    case "/courses":
      Component = Courses
      break

    case "/about":
      Component = About
      break
  }

  return (

    <div className="App">
      <>
        <Navbar/>
        <Component/> 
      </>

      {/* <button className = "loginButton">Login</button> */}

      <p className="helloWorld">
        Hello World
      </p>


    </div>


  );
}

export default App;
